{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":4784355,"sourceType":"datasetVersion","datasetId":2769418}],"dockerImageVersionId":30303,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/uber-data-analysis-using-r?scriptVersionId=169468761\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Uber Data Analysis using R\n\n- With over 118 million users, 5 million drivers, and 6.3 billion trips with 17.4 million trips completed per day - Uber is the company behind the data for moving people and making deliveries hassle-free.\n- How are drivers assigned to riders cost-efficiently, and how is dynamic pricing leveraged to balance supply and demand? \n- Thanks to the large volumes of data Uber collects and the fantastic team that handles Uber Data Analysis using Machine Learning tools and frameworks. \n- If you’re curious to learn more about how data analysis is done at Uber to ensure positive experiences for riders while making the ride profitable for the company - Get your hands dirty working with the Uber dataset to gain in-depth insights.\n\n\n- Data storytelling is an important component of Machine Learning through which companies are able to understand the background of various operations. \n- With the help of visualization, companies can avail the benefit of understanding complex data and gaining insights that would help them to craft decisions. \n- This is more of a data visualization project that will guide you towards using the ggplot2 library for understanding the data and for developing an intuition for understanding the customers who avail the trips.\n\n- In this data analysis, we analyze Uber data from 1th April 2014 to 30th September 2014.\n\n- The goal of this project is to learn visualizations in R.\n\n- Dataset: [Kaggle](https://www.kaggle.com/datasets/amirmotefaker/uber-dataset-from-april-to-september-2014)\n\n![image.png](attachment:098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png)","metadata":{},"attachments":{"098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Import Libraries","metadata":{}},{"cell_type":"code","source":"library(ggplot2)\nlibrary(ggthemes)\nlibrary(lubridate)\nlibrary(dplyr)\nlibrary(tidyr)\nlibrary(DT)\nlibrary(scales)\n#library(data.table) # Import big files (CSV or Text) \n#library(readxl) # Import Excel files","metadata":{"execution":{"iopub.status.busy":"2024-03-30T16:59:22.029634Z","iopub.execute_input":"2024-03-30T16:59:22.032456Z","iopub.status.idle":"2024-03-30T16:59:23.148497Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n\nAttaching package: ‘dplyr’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    filter, lag\n\n\nThe following objects are masked from ‘package:base’:\n\n    intersect, setdiff, setequal, union\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"# Creating vector of colors for the plots","metadata":{}},{"cell_type":"code","source":"colors = c(\"#CC1011\", \"#665555\", \"#05a399\", \"#cfcaca\", \"#f5e840\", \"#0683c9\", \"#e075b0\")\ncolors","metadata":{"execution":{"iopub.status.busy":"2024-03-30T16:59:23.152989Z","iopub.execute_input":"2024-03-30T16:59:23.205606Z","iopub.status.idle":"2024-03-30T16:59:23.23886Z"},"trusted":true},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/html":"<styl